    % Layer 3
    a3 = tansig_apply(repmat(b3,1,Q) + LW3_2*a2);
    
    % Layer 4
    a4 = softmax_apply(repmat(b4,1,Q) + LW4_3*a3);
    
    % Output 1
    Y{1,ts} = a4;
